  false,\n\t\"url\": null,\n\t\"notes\": \"The Department of Finance (DOF) is required
  by NY State law to value condominiums or cooperatives as if they were residential
  rental apartment buildings.   DOF uses income information from rental properties
  similar in physical features and location to the condominiums or cooperatives. DOF
  applies this income data to the condominium or cooperative and determine its value
  in the same way DOF values rental apartment buildings.rnUpdate Schedule: Annually\",\n\t\"license_title\":
